def tri(big_liste):
    tp={}
    note={}
    for liste in big_liste:
        for i in liste:
            if str(i['TP']) in tp:
                #print('a')
                tp[str(i['TP'])]+=1
            else:
                #print('b')
                tp[str(i['TP'])]=1

            if str(i['note']) in note:
                note[str(i['note'])]+=1
            else:
                note[str(i['note'])]=1
    return [tp, note]





